import React from "react"
import styles from "./Cards.module.css"
import Card from "./Card/Card"
const Cards = (props)=>{
  const cards = props.data.data.emotion.map((element, index) => (
    <Card data = {element} key = {index}></Card>
  ));
  return(
    <div>
      {cards}
    </div>
  )
}
export default Cards
